    # Check update
    def update_check(self,tilex):
        ret = True

        active_tile = self.tv.get_tile_active() 
        if active_tile != tilex:
            ret = False

        return ret

    # Data update
    def imu_data_acc_update(self):
        # Read QMI8658
        xyz = self.IMU.Read_XYZ()
        
        for i in range(0,3):
            table_text = "{:4.1f}".format(xyz[i])
            self.table_imu_data_acc.set_cell_value(i, 0, table_text)
            
    def imu_data_gyro_update(self):
        # Read QMI8658
        xyz = self.IMU.Read_XYZ()  
        
        for i in range(3,6):
            table_text = "{:4.1f}".format(xyz[i])
            self.table_imu_data_gyro.set_cell_value(i-3, 0, table_text)
            
    def bat_data_update(self):
        # Read ADC
        Vbat= machine.ADC(machine.Pin(29))
        voltage  = Vbat.read_u16()*3.34/65535 * 2
        self.label.set_text(f"{voltage:.2f} V")
                
    # Timer callback
    def imu_data_update_timer_cb(self,t):
        # Check update
        if self.update_check(self.tile2) == True:
            # Update data
            self.imu_data_acc_update()
            
        elif self.update_check(self.tile3) == True:
            # Update data
            self.imu_data_gyro_update()
            
        return
    
    # Timer callback
    def bat_data_update_timer_cb(self,t):
        if self.update_check(self.tile4) == True:
            # Update data
            self.bat_data_update()
            
        return




